import React from 'react';
import {useNavigate} from "react-router-dom";

interface ActionCardProps {
  label: string;
  href: string;
}
export const ActionCard : React.FC<ActionCardProps> = ({label, href}) => {
  const navigate = useNavigate();
  const handleClick = () => {
    navigate(href);
  }
  return (
    <div onClick={handleClick} style={{display:"flex", flexDirection:"column", alignSelf:"center", justifyContent:"center", height: "140px", width:"140px", background:"#FFFFFF"}}>
      {label}
    </div>
  )
}
